const RegularCustomer=[
  {
      title:"Regular customer",
  },
  {
      text:"To enjoy our service, you need to register on the site.",
  },
  {
      text:"Fill in all the personal details.",
  },
  {
      text:"Choose a username (the password is the customer's ID).",
  },
  {
    text:"We will send you an address (the address is uniform for all customers!)",
  },
  {
    text:"When the customer places an order online, he chooses the Flash Box service or types in the address he received.",
  },
  {
    text:"As soon as the package arrives to us we send it to the customer's house.",
  },
  {
    text:"This means that he does not have to collect the package himself or go to Collection points rather, we send it to his home!",
  },
  {
    text:"our service is also relevant for sending packages to anyone you wants, (from the customer's home to the recipient's home)."
  }
]

export default RegularCustomer
